func TestEncapsulate1024ACVP(t *testing.T) {
	for i, tc := range encap1024InternalProjectionCases {
		ek, _ := hex.DecodeString(tc.ek)
		dk, _ := hex.DecodeString(tc.dk)
		c, _ := hex.DecodeString(tc.c)
		k, _ := hex.DecodeString(tc.k)
		m, _ := hex.DecodeString(tc.m)

		ek1, err := NewEncapsulationKey1024(ek)
		if err != nil {
			t.Fatalf("case %d: NewEncapsulationKey1024: %v", i, err)
		}
		if !bytes.Equal(ek1.Bytes(), ek) {
			t.Fatalf("case %d: encapsulation key mismatch", i)
		}
		k1, c1 := ek1.EncapsulateInternal((*[32]byte)(m))
		if !bytes.Equal(c1, c) {
			t.Fatalf("case %d: ciphertext mismatch", i)
		}
		if !bytes.Equal(k1, k) {
			t.Fatalf("case %d: shared secret mismatch", i)
		}

		dk1, err := NewDecapsulationKey1024(dk)
		if err != nil {
			t.Fatalf("case %d: NewDecapsulationKey1024: %v", i, err)
		}
		if !bytes.Equal(dk1.Bytes(), dk) {
			t.Fatalf("case %d: decapsulation key mismatch", i)
		}

		k2, err := dk1.Decapsulate(c)
		if err != nil {
			t.Fatalf("case %d: Decapsulate: %v", i, err)
		}
		if !bytes.Equal(k2, k) {
			t.Fatalf("case %d: shared secret mismatch", i)
		}
	}
}

// https://github.com/usnistgov/ACVP-Server/blob/master/gen-val/json-files/ML-KEM-encapDecap-FIPS203/internalProjection.json
var decap1024InternalProjectionCases = []struct {
	tcId    int
	ek      string
	dk      string
	c       string
	k       string
	success bool
}{
	{
		96,
		"",
		"",
		"",
		"74E9A374CFD12E92610591E05E80F256FA9BC85146F678C0FD538ACBBB765A6B",
		true,
	},
	{
		97,
		"",
		"",
		"",
		"0178BDCD5B5412B1C06884AD4CA3EB43607566114B599A22323C508578F1CCCA",
		false,
	},
	{
		98,
		"",
		"",
		"",
		"AC32764AABF8926EC41754181B2CFF101B907C0D60FB92638214AB9164E24F2F",
		false,
	},
	{
		99,
		"",
		"",
		"",
		"90DEDD24590FEDFF42A27AB44173E0711839EC9D15728D7A0C191CE6CE5CBC68",
		false,
	},
}

func TestDecapsulate1024ACVP(t *testing.T) {
	for i, tc := range decap1024InternalProjectionCases {
		//ek, _ := hex.DecodeString(tc.ek)
		dk, _ := hex.DecodeString(tc.dk)
		c, _ := hex.DecodeString(tc.c)
		k, _ := hex.DecodeString(tc.k)

		dk1, err := NewDecapsulationKey1024(dk)
		if err != nil {
			t.Fatalf("case %d: NewDecapsulationKey1024: %v", i, err)
		}
		if !tc.success {
			c[0] ^= 0xFF // Corrupt the ciphertext to force failure
		}
		k1, err := dk1.Decapsulate(c)
		if tc.success {
			if err != nil {
				t.Fatalf("case %d: Decapsulate: %v", i, err)
			}
			if !bytes.Equal(k1, k) {
				t.Fatalf("case %d: shared secret mismatch", i)
			}
		} else {
			if bytes.Equal(k1, k) {
				t.Fatalf("case %d: decapsulation should have failed", i)
			}
		}
	}
}

func BenchmarkKeyGen1024(b *testing.B) {
	var seed [64]byte
	rand.Read(seed[:])
	b.ResetTimer()
	for b.Loop() {
		if _, err := NewDecapsulationKeyFromSeed1024(seed[:]); err != nil {
			b.Fatalf("NewDecapsulationKeyFromSeed1024 failed: %v", err)
		}
	}
}

func BenchmarkEncapsulateInternal1024(b *testing.B) {
	tc := encap1024InternalProjectionCases[0]
	ek, _ := hex.DecodeString(tc.ek)
	m, _ := hex.DecodeString(tc.m)
	ek1, err := NewEncapsulationKey1024(ek)
	if err != nil {
		b.Fatalf("NewEncapsulationKey1024: %v", err)
	}

	b.ResetTimer()
	for b.Loop() {
		ek1.EncapsulateInternal((*[32]byte)(m))
	}
}

func BenchmarkDecapsulate1024(b *testing.B) {
	tc := decap1024InternalProjectionCases[0]
	dk, _ := hex.DecodeString(tc.dk)
	c, _ := hex.DecodeString(tc.c)

	dk1, err := NewDecapsulationKey1024(dk)
	if err != nil {
		b.Fatalf("NewDecapsulationKey1024: %v", err)
	}

	b.ResetTimer()
	for b.Loop() {
		if _, err := dk1.Decapsulate(c); err != nil {
			b.Fatalf("Decapsulate: %v", err)
		}
	}
}
